import './App.css';
import React, { useState, useEffect } from 'react';

function StoreList() {
  const [stores, setStores] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/stores')
      .then(response => response.json())
      .then(data => setStores(data.data))  // Access the stores data
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  return (
    <div>
      <h1>Store List</h1>
      <ul>
        {stores.map(store => (
          <li key={store.id}>
            {store.attributes.name} - Rating: {store.attributes.rating}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default StoreList;
